{"operationName":"GetComposableDataForEdition","variables":{"id":"25545000"},"query":"query GetComposableDataForEdition($id: String!) {
  composableData: composables(where: {id: $id}) {
    id
    items {
      id
      value
      type
      address
      tokenID
      __typename
    }
    __typename
  }
}
"}
